import React from "react";
import { Image } from "@chakra-ui/image";
import { useColorMode } from "@chakra-ui/color-mode";
import { useMediaQuery } from "@chakra-ui/media-query";
import { Stack, Circle, Flex, Box, Text, Heading } from "@chakra-ui/layout";
import { CircularProgressbar, buildStyles } from "react-circular-progressbar";
import Skill from './Skill'
import Lottie from 'react-lottie';
import skillsimage from "../../images/Blogging"



const Skills = () => {
    const defaultOptions = {
        loop: true,
        autoplay: true,
        animationData: skillsimage,
        rendererSettings: {
          preserveAspectRatio: "xMidYMid slice"
        }
      };
    const { colorMode } = useColorMode();
    const isDark = colorMode === "dark";
    const [isNotSmallerScreen] = useMediaQuery("(min-width:600px)");
    return (
        <Stack w = "100%" p = {6}  direction="row" id="skillsection" m = {0}>
            <Flex  direction="column" id = "projectsection" justifyContent = "center">

{!isNotSmallerScreen ?
<Box alignSelf="flex-start" mx = "10" position = "relative" top = {isNotSmallerScreen ? "100" : "0"}>
    <Heading fontWeight="extrabold" color="cyan.500" size="4xl">
            Projects
        </Heading>
        <Text fontSize="2xl" color="gray.400">Carry on! exploring</Text>
</Box> :  

 <Box alignSelf="flex-start" mx = "10" position = "relative" top = {isNotSmallerScreen ? "100" : "0"}>
     <Flex>
     <Flex direction="column">
        <Heading fontWeight="extrabold" color="cyan.500" size="4xl">
            Projects
        </Heading>
        <Text fontSize="2xl" color="gray.400">Carry on! exploring</Text>
     </Flex>

    <Flex direction="column">
    <Circle className = "aboutcircle1" position="relative" bg="blue.100" opacity={isDark?"0.1":"0.4"} top="0" left="-200"
        w={isNotSmallerScreen?"500px":"450px"} h={isNotSmallerScreen?"100px":"450px"} alignSelf={isNotSmallerScreen ? "flex-start" : "flex-end"} />
        <Circle  className = "aboutcircle2" position="relative" bg="blue.100" opacity={isDark?"0.1":"0.4"} top="-8" left="-230"
         w={isNotSmallerScreen?"400px":"450px"} h={isNotSmallerScreen?"100px":"450px"} alignSelf={isNotSmallerScreen ? "flex-start" : "flex-end"} />
    </Flex>
    </Flex>

</Box>
}
</Flex>
          <Flex w={isNotSmallerScreen ? "60%" : "100%"} bg = {isDark ? "gray.600" : "cyan.200"}  borderRadius = "30" 
          direction={isNotSmallerScreen ? "row" : "column"}
        //   spacing="200px"
        //   justifyContent = "space-evenly"
          p={isNotSmallerScreen ? "25" : "0"}
          alignSelf="flex-start"
        //   alignItems="center"
          flexWrap={isNotSmallerScreen ? "wrap" : null}
          mb = {12}>
                <Skill
                    skillvalue = {95}
                    skillcolor = "#a903fc"
                    skillsub = "HTML/CSS"
                    skilldesc = "Handsome Experience in HTML/CSS"
                />
                <Skill
                    skillvalue = {85}
                    skillcolor = "#fcba03"
                    skillsub = "ReactJS/NextJS"
                    skilldesc = "Handsome Experience in ReactJS"
                />

                <Skill
                    skillvalue = {90}
                    skillcolor = "red"
                    skillsub = "JavaScript"
                    skilldesc = "Handsome Experience in Javascript"
                />
                <Skill
                    skillvalue = {75}
                    skillcolor = "#6203fc"
                    skillsub = "NodeJS/Express"
                    skilldesc = "Handsome Experience in NodeJS"
                />
                <Skill
                    skillvalue = {80}
                    skillcolor = "#048725"
                    skillsub = "MongoDB"
                    skilldesc = "Handsome Experience in MongoDB"
                />
                <Skill
                    skillvalue = {85}
                    skillcolor = "#b87c06"
                    skillsub = "Bootsrap"
                    skilldesc = "Handsome Experience in Bootstrap"
                />

          </Flex> 
          {isNotSmallerScreen ?  
          <Lottie style = {{position:"absolute", top: "50", left:"50%"}}
                options={defaultOptions}
                height={450}
                width={650}
                />
           : null } 

        </Stack>
    )
}

export default Skills
